import React from 'react';

export default function Homepage() {
  const bodyStyle = {
    backgroundColor: 'mediumpurple'
  }
  const wText = {
    color: 'antiquewhite'
  }

  return (
    <div style={bodyStyle}>
      <h1 style={wText}>Dylan Mcgrann</h1>
      <h3>projects</h3>
      <h3>languages</h3>
      <h3>frameworks</h3>
    </div>
  )
}
